Joomla.sendForm = (task, form, validate) => {
  if (form === null) {
    form = document.getElementById('adminForm');
  }
  Joomla.submitform(task, form, validate);
};
Joomla.submitbutton = (task, form, validate) => {
  Joomla.sendForm(task, form, validate);
};
Joomla.listItemTask = function (id, task) {
  let form = arguments.length > 2 && arguments[2] !== undefined ? arguments[2] : null;
  let newForm = form;
  if (form !== null) {
    newForm = document.getElementById(form);
  } else {
    newForm = document.getElementById('adminForm');
  }
  const cb = newForm[id];
  let i = 0,
    cbx;
  if (!cb) {
    return false;
  }
  while (true) {
    cbx = newForm[`cb${i}`];
    if (!cbx) {
      break;
    }
    cbx.checked = false;
    i += 1;
  }
  cb.checked = true;
  newForm.boxchecked.value = 1;
  Joomla.sendForm(task, newForm);
  return false;
};
Joomla.submitFilter = form => {
  document.body.appendChild(document.createElement('joomla-core-loader'));
  // Fix multi select fields
  let multiSelects = form.querySelectorAll('select[multiple]');
  if (multiSelects.length > 0) {
    multiSelects.forEach(select => {
      if (select.value === '') {
        let fakeInput = document.createElement('input');
        fakeInput.setAttribute('name', select.getAttribute('name').replace('[]', ''));
        fakeInput.setAttribute('type', 'hidden');
        fakeInput.setAttribute('value', '');
        form.append(fakeInput);
      }
    });
  }
  form.submit();
};
document.addEventListener('DOMContentLoaded', () => {
  let currentUrl = new URL(window.location.href);
  if (currentUrl.href.includes('&filter')) {
    let viewParam = currentUrl.searchParams.get('view'),
      baseUrl = currentUrl.pathname + '?option=com_nevigen_audit&view=' + viewParam;
    sessionStorage.setItem(baseUrl, 'list');
    let tab = document.querySelector('joomla-tab  button[aria-controls="list"]');
    if (tab) {
      tab.click();
    }
  }
  document.querySelectorAll('[batch-task]').forEach(button => {
    button.addEventListener('click', event => {
      event.preventDefault();
      let task = button.getAttribute('batch-task');
      Joomla.sendForm(task);
    });
  });
});
